import React from 'react';
import ReactDOM from 'react-dom';
import App from "./App.js"
import { BrowserRouter, Switch } from "react-router-dom";

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
    <Switch> 
      <App />
    </Switch>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
